  return {
    isLoggedIn: false,
    sessionId: v4(),
    fetch: (...args) => uniFetch.call(globalThis, ...args),
  };
}

/**
 * @param sessionId
 * @param storage
 * @hidden
 */
export async function clear(
  sessionId: string,
  storage: IStorageUtility
): Promise<void> {
  await Promise.all([
    storage.deleteAllUserData(sessionId, { secure: false }),
    storage.deleteAllUserData(sessionId, { secure: true }),
  ]);
}

